import React, {Component} from 'react'

class Home extends Component {
    componentDidMount(){
        const hpTheme = new Audio('Harry_Potter_Theme_Song_Hedwigs_Theme.mp3')
        hpTheme.play()
    }
    render(){
        return(
            <div className='home'>Home</div>
        )
    }
}

export default Home
